import React, { Component } from 'react';
import '../../App.css';
import Forms from '../Forms/formComponent';
import Table from '../Table/tableComponent';
import MainPage from '../Pages/MainPage/mainpage';
import { Route,Link } from 'react-router-dom';

class Header extends Component {
    render() {

      return (
        <header id="home" className="Header">
        <nav id="nav-wrap">
           <ul id="nav" className="nav">
           <li className="current"> <Link to="/">Company Logo</Link></li>
              <li className="current"><Link>Home</Link></li>
              <li><Link>Forms</Link></li>
               <li><Link>Table</Link></li>
              <li><Link>Table</Link></li>
            </ul>
        </nav>
        <div className="pages">
        {/* <Route path="/" exact render={()=> <h1>jdhfkjds</h1>}/> */}
        <Route path="/" exact component={MainPage}/>
        <Route path="/forms"  component={Forms}/>
        <Route path="/table"  component={Table}/>
        {/* <MainPage></MainPage> */}
        </div>
     </header>
      );
    }
  }

  export default Header;
